import React from "react";
import UserCard from "../../ui/user-card/user-card.jsx";
import MenuLink from "../../ui/menu-link/menu-link.jsx";

function UserMenu (props) {

    <div> 
        <UserCard  username="Roman Kutepov"  position="Brain Director"/>
        <div> 
            <ul> 
                <li> <MenuLink  text="Dashboard" /> </li>
                <li> <MenuLink  text="Users" /> </li>
                <li> <MenuLink  text="Products" /> </li>
                <li> <MenuLink  text="Authentication" /> </li>
                <li> <MenuLink  text="Typography" /> </li>
                <li> <MenuLink  text="Icons Images" /> </li>
            </ul>
        </div>
    </div>

};

export default UserMenu;
